import React from "react";
import Header from './components/Header'
import Image from './components/Image' 
import car from "./img/gwagon.jpg"
import { useState, useEffect } from "react";

function User({ id }) {
  useEffect(() => {
    console.log(`Загружен пользователь с ID: ${id}`);
  }, []);

  return <p>Пользователь {id}</p>;
}

function Button() {
  const [userId, setUserId] = useState(null);
  <button onClick={() => setUserId(userId + 1)}></button>
  return <User key={userId} id={userId} />
}

class App extends React.Component {
    state = {   
        helpText: "Help text"
    }

  inputClick = (event) => {
    console.log("Clicked", event)
    this.setState({
        helpText: "GWAGON"
    });
  };

  mouseOver() {console.log("Mouse over")}

  render(){
    return (
    <div>
        <Header text="My header"/>5дб
        <h1>{this.props.text}</h1>
        <input placeholder={this.state.helpText} onClick={this.inputClick} onMouseEnter={this.mouseOver} onChange={helpText => this.setState({helpText: "aaaa"})}/>
        
        <Button />
        <Image image={car}/>
    </div>
    )
  }
}

export default App
